export default function ShowItems() {


    const checkboxClicked = (event) => {
        dispatch({ type: "ShowUndoneCheckboxToggled", event: event.target.checked })
    }

    return (
        <>
            <div className="mt-6">
                <label>Show Undone </label>
                <input type="checkbox" onClick={checkboxClicked} />
            </div>
        </>
    );

}
